import Header from "../components/Header";

function Favourites({ children, cities, onDelete }) {
    document.title = "Ulubione";
    return (
        <div>
            <Header />
            <div className="favs-container">
                <table>
                    <tbody>
                        {cities.map((city, i) => {
                            console.log(i);
                            return (
                                <RenderCity
                                    city={city}
                                    onClick={onDelete}
                                    cities={cities}
                                    i={i}
                                />
                            );
                        })}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

